function createIcons()
{
	addCss("#map-option{ max-width: 186px; background-repeat: initial; height:70px; }");
	addCss("#map-option::before{ height: 76px; }");
	addCss("#map-option::after{ height: 76px; }");
	addCss("#map-option a{ margin-top: 2px; }");
	addCss("#map-content{ top: 135px; }");

	$('#map-option > a.sh.hb.lb.moveTo.switch-class').after('<a id="fivePopulationSelector" class="sh hb lb" href="#" title="Afficher les plantes ayant '+population.toString()+' de population"><img src="'+population_pic+'" alt="minimap"></a>');
	document.getElementById('fivePopulationSelector').addEventListener('click', togglePopulation, false);

	$('#fivePopulationSelector').after('<a id="fiveResourcesSelector" class="sh hb lb" href="#" title="Afficher les plantes ayant '+resource.toString()+' en coefficient ressource"><img src="'+resource_pic+'" alt="minimap"></a>');
	document.getElementById('fiveResourcesSelector').addEventListener('click', toggleResource, false);

	$('#fiveResourcesSelector').after('<a id="fiveScienceSelector" class="sh hb lb" href="#" title="Afficher les plantes ayant '+science.toString()+' en science" ><img src="'+science_pic+'" alt="minimap"></a>');
	document.getElementById('fiveScienceSelector').addEventListener('click', toggleScience, false);
}

function togglePopulation()
{
	populationBool = !populationBool;
	process();
}

function toggleResource()
{
	resourceBool = !resourceBool;
	process();
}

function toggleScience()
{
	scienceBool = !scienceBool;
	process();
}

function process()
{
	if(resourceBool || scienceBool || populationBool)
	{
        preprocess();
        if(preprocessed < 2)
            setTimeout(function() { process(); }, 1000);
		else
			refresh();
	}
	if(resourceBool && scienceBool && populationBool)
	{
        refresh();
		showAll();
	}
}

function refresh()
{
	hideAll();
	if(resourceBool > 0)
	{
		$('[class*=topResource]').show();
		$("#fiveResourcesSelector").addClass("active");
	}
	else
	{
		$("#fiveResourcesSelector").removeClass("active");
	}
	if(populationBool > 0)
	{
		$('[class*=topPopulation]').show();
		$("#fivePopulationSelector").addClass("active");
	}
	else
	{
		$("#fivePopulationSelector").removeClass("active");
	}
	if(scienceBool > 0)
	{
		$('[class*=topScience]').show();
		$("#fiveScienceSelector").addClass("active");
	}
	else
	{
		$("#fiveScienceSelector").removeClass("active");
	}
}

function ressToIcon(ress)
{
	return Math.min(5, Math.floor(ress / 20) + 1)
}

function popToIcon(pop)
{
	return Math.min(5, Math.floor(pop / 50) + 1)
}

function coeffToSci(coeff)
{
	return Math.max(0, Math.min(40, Math.ceil(0.004 * coeff * coeff - 0.01 * coeff + 0.7)))
}

function sciToIcon(coeff)
{
	return Math.min(5, Math.floor(coeffToSci(coeff) / 8) + 1)
}

function preprocess()
{
	if(!preprocessed)
	{
		preprocessed = 1;
		for(var planet of planetList.systems)
		{
			if(planet.typeOfPlace == 1)
			{
				if(~resource.indexOf(ressToIcon(planet.resources)))
					$("[data-system-id="+planet.system+"]").addClass("topResource");
				if(~population.indexOf(popToIcon(planet.population)))
					$("[data-system-id="+planet.system+"]").addClass("topPopulation");
				if(~science.indexOf(sciToIcon(planet.science)))
					$("[data-system-id="+planet.system+"]").addClass("topScience");
			}
		}
		preprocessed = 2;
	}
}

function setOpacity(relId, opa) {
	document.getElementById("action-box").querySelector('a.openplace[data-target="' + relId + '"]').getElementsByTagName("img")[0].style.opacity = opa;
}

function find(id) {
	var i = 0;
	while(i < planetList.systems.length && planetList.systems[i].planetid != id) {
		++i;
	}
	return i;
}

function topPlanete(planete) {
	var link = planete.querySelector('a[data-url*="placeid-"]');
	if(link != null) {
		var id = find(parseInt(planete.querySelector('a[data-url*="placeid-"]').getAttribute("data-url").match(/placeid\-([0-9]+)/)[1]));
		if(planetList.systems[id].typeOfPlace == 1)
		{
			if(populationBool && ~population.indexOf(popToIcon(planetList.systems[id].population)))
				return true;
			if(resourceBool && ~resource.indexOf(ressToIcon(planetList.systems[id].resources)))
				return true;
			if(scienceBool && ~science.indexOf(sciToIcon(planetList.systems[id].science)))
				return true;
		}
	}
	return false;
}

